import React from "react";
import { NavLink } from 'react-router-dom';

export const NavBar = () => {
    return (
        <nav className="NavBar">
            <NavLink exact to="/">
                Vending Machine
            </NavLink>
            <NavLink exact to="/BubbleTea">
                Bubble Tea
            </NavLink>
            <NavLink exact to="/Popcorn">
                Popcorn
            </NavLink>
            <NavLink exact to="/RedBeanBun">
                Red Bean Bun
            </NavLink>
        </nav>
    );
}
